			</div>
			<UsersContainer />
			<button className={classes.btnShow}>Показать больше</button>
			
			<div>
				<button onClick={addItem}>Добавить элемент</button>
				<ul>
					{items.map(item => (
						<li key={item}>{item}</li>
					))}
				</ul>
			</div>
		</>
	)
}

